 createClass<IButtonProps, {}>({
	displayName: 'Button',

	statics: {
		peek: {
			description: `
				A basic button. Any props that are not explicitly called out below will
				be passed through to the native \`button\` component.
			`,
			categories: ['controls', 'buttons'],
		},
	},

	propName: 'Button',

	propTypes: {
		isDisabled: bool`
			Disables the Button by greying it out
		`,

		isActive: bool`
			Activates the Button by giving it a "pressed down" look
		`,

		className: string`
			Class names that are appended to the defaults
		`,

		hasOnlyIcon: bool`
			Set this to \`true\` if you want the Button to only contain an icon.
		`,

		children: oneOfType([node, arrayOf(node)])`
			Any valid React children
		`,

		kind: oneOf(['primary', 'link', 'danger', 'invisible'])`
			Style variations of the Button
		`,

		size: oneOf(['short', 'small', 'large'])`
			Size variations of the Button
		`,

		onClick: func`
			Called when the user clicks the \`Button\`.
		`,

		type: string`
			Form element type variations of Button. Passed through to DOM Button.
		`,
	},

	getDefaultProps() {
		return {
			isDisabled: false,
			isActive: false,
			onClick: _.noop,
			type: 'button',
			hasOnlyIcon: false,
		};
	},

	handleClick(event: React.MouseEventHandler<HTMLButtonElement>) {
		const { isDisabled, onClick } = this.props;

		if (!isDisabled) {
			// required to correctly apply the focus state in Safari and Firefox
			// (still valid 2019-07-22)
			this.buttonRef.focus();
			onClick({ event, props: this.props });
		}
	},

	render() {
		const {
			isDisabled,
			isActive,
			hasOnlyIcon,
			kind,
			size,
			className,
			children,
			type,
			...passThroughs
		} = this.props;

		return (
			<button
				{...omitProps(passThroughs, Button, ['callbackId'])}
				ref={ref => {
					this.buttonRef = ref;
				}}
				className={cx(
					'&',
					{
						'&-is-disabled': isDisabled,
						'&-is-active': isActive,
						'&-primary': kind === 'primary',
						'&-link': kind === 'link',
						'&-invisible': kind === 'invisible',
						'&-danger': kind === 'danger',
						'&-short': size === 'short',
						'&-small': size === 'small',
						'&-large': size === 'large',
						'&-has-only-icon': hasOnlyIcon,
					},
					className
				)}
				onClick={this.handleClick}
				disabled={isDisabled}
				type={type}
			>
				<span className={cx('&-content')}>{children}</span>
			</button>
		);
	},
})

 createClass<ICollapsibleProps, {}>({
	displayName: 'Collapsible',

	statics: {
		peek: {
			description: `
				This is a simple container that can render content as expanded or
				collapsed.
			`,
			categories: ['utility'],
		},
	},

	_isPrivate: true,

	propTypes: {
		children: node`
			Expandable content.
		`,

		className: string`
			Appended to the component-specific class names set on the root element.
		`,

		isExpanded: bool`
			Indicates that the component is in the "expanded" state when true and in
			the "unexpanded" state when false.
		`,

		isAnimated: bool`
			Show an animated transition for alternating values of \`isExpanded\`.
		`,

		isMountControlled: bool`
			If true, do not render children when fully collapsed.
		`,

		mountControlThreshold: number`
			If \`isMountControlled\` is true, this value sets is the minimum height
			the container needs to reach to not render any children.
		`,

		rootType: any`
			Pass in a custom root element type.
		`,
	},

	getDefaultProps() {
		return {
			isExpanded: true,
			isAnimated: true,
			isMountControlled: true,
			mountControlThreshold: 4,
			rootType: 'div',
		};
	},

	getInitialState() {
		return {
			maxHeight: null,
		};
	},

	componentWillMount() {
		this.isAnimated = false;
		this.delayTimer = null;
	},

	componentDidMount() {
		_.delay(() => {
			this.setState({
				maxHeight: _.get(this, 'rootRef.scrollHeight'),
			});
			this.isAnimated = this.props.isAnimated;
		}, 32);
	},

	componentDidUpdate() {
		this.isAnimated = false;
		this.delayTimer = _.delay(() => {
			if (this.props.isExpanded) {
				const maxHeight = _.get(this, 'rootRef.scrollHeight');
				if (maxHeight !== this.state.maxHeight) {
					this.setState({
						maxHeight,
					});
				}
			}
			this.isAnimated = this.props.isAnimated;
		}, 32);
	},

	componentWillUnmount() {
		this.delayTimer && clearTimeout(this.delayTimer);
	},

	render() {
		const {
			children,
			className,
			isExpanded,
			isMountControlled,
			mountControlThreshold,
			rootType,
			...passThroughs
		} = this.props;

		const { maxHeight } = this.state;

		return (
			<Motion
				style={
					this.isAnimated
						? {
								height:
									isExpanded && !_.isNull(maxHeight)
										? spring(maxHeight, QUICK_SLIDE_MOTION)
										: spring(0, QUICK_SLIDE_MOTION),
						  }
						: {
								height: isExpanded && !_.isNull(maxHeight) ? maxHeight : 0,
						  }
				}
			>
				{tween =>
					React.createElement(
						rootType,
						{
							...omitProps(passThroughs, Collapsible),
							ref: (ref: any) => (this.rootRef = ref),
							className: cx('&', className),
							style: {
								height:
									tween.height !== maxHeight
										? tween.height < 0
											? 0
											: tween.height
										: null,
								overflow: 'hidden',
								padding: 0,
								...passThroughs.style,
							},
						},
						[
							<div
								key='content'
								className={cx('&-content')}
								style={{ margin: 0 }}
							>
								{isMountControlled && !isExpanded
									? _.isNull(maxHeight) ||
									  Math.abs(tween.height) > mountControlThreshold
										? children
										: null
									: children}
							</div>,
						]
					)
				}
			</Motion>
		);
	},
})

 createClass<IExpanderProps, IExpanderState>({
	displayName: 'Expander',

	statics: {
		peek: {
			description: `
				This is a container that provides a toggle that controls when the
				content is shown.
			`,
			categories: ['layout'],
			madeFrom: ['ChevronIcon'],
		},
	},

	components: {
		Label: createClass<IExpanderLabelProps, {}>({
			displayName: 'Expander.Label',
			statics: {
				peek: {
					description: `
						Renders a \`<span>\` to be shown next to the expander icon.
					`,
				},
			},
			propName: 'Label',
			propTypes: {
				children: node`
					Used to identify the purpose of this switch to the user -- can be any
					renderable content.
				`,
			},
		}),
		AdditionalLabelContent: createClass<IExpanderAdditionalLabelProps, {}>({
			displayName: 'Expander.AdditionalLabelContent',
			statics: {
				peek: {
					description: `
						Renders a \`<span>\` to be shown next to the expander label.
					`,
				},
			},
			propName: 'AdditionalLabelContent',
			propTypes: {
				children: node`
					Used to display additional information or/and actions next to expander label.
				`,
			},
		}),
	},

	reducers,

	propTypes: {
		children: node`
			Expandable content.
		`,

		className: string`
			Appended to the component-specific class names set on the root element.
		`,

		isExpanded: bool`
			Indicates that the component is in the "expanded" state when true and in
			the "unexpanded" state when false.
		`,

		onToggle: func`
			Called when the user clicks on the component's header.  Signature:
			\`(isExpanded, { event, props }) => {}\`
		`,

		style: object`
			Passed through to the root element.
		`,

		Label: any`
			Child element whose children represents content to be shown next to the
			expander icon.
		`,

		AdditionalLabelContent: node`
			Child element whose children respresent content to be shown inside
			Expander.Label and to the right of it
		`,

		kind: oneOf(['simple', 'highlighted'])`
			Renders different variants of Expander. 'simple' is default.
			'highlighted' is more prominant.
		`,
	},

	getDefaultProps() {
		return {
			isExpanded: false,
			onToggle: _.noop,
			kind: 'simple',
		};
	},

	render() {
		const {
			children,
			className,
			isExpanded,
			style,
			kind,
			...passThroughs
		} = this.props;

		const labelChildProp = _.first(
			_.map(findTypes(this.props, Expander.Label), 'props')
		);

		const additionalLabelContentChildProp = _.first(
			_.map(findTypes(this.props, Expander.AdditionalLabelContent), 'props')
		);

		return (
			<div
				{...omitProps(passThroughs, Expander)}
				className={cx(
					'&',
					{
						'&-is-expanded': isExpanded,
						'&-kind-highlighted': kind === 'highlighted',
					},
					className
				)}
				style={style}
			>
				<header className={cx('&-header')}>
					<div className={cx('&-header-toggle')} onClick={this.handleToggle}>
						<Button
							className={cx('&-icon')}
							kind='invisible'
							hasOnlyIcon={true}
						>
							<ChevronIcon direction={isExpanded ? 'up' : 'down'} />
						</Button>
						{labelChildProp && (
							<span className={cx('&-text')}>{labelChildProp.children}</span>
						)}
					</div>
					{additionalLabelContentChildProp && (
						<div className={cx('&-additional-content')}>
							{additionalLabelContentChildProp.children}
						</div>
					)}
				</header>
				<Collapsible
					isExpanded={isExpanded}
					rootType='section'
					className={cx('&-content')}
				>
					{children}
				</Collapsible>
			</div>
		);
	},

	handleToggle(event: React.MouseEventHandler) {
		this.props.onToggle(!this.props.isExpanded, {
			event,
			props: this.props,
		});
	},
})

 createClass<IChevronIconProps, {}>({
